import React from 'react';
import { Grid } from '@material-ui/core';
import PicHome from './img/3330672.jpg';
import { makeStyles } from '@material-ui/core/styles';


const useStyles = makeStyles((theme) => ({
  root:{
    textAlign:'center'
  }
}));

function Home() {
  const classes = useStyles();

  return (
    <div className="">
        <Grid container spacing={0} className={classes.root} direction="row"  alignItems="center" justify="center" 
         style={{ maxHeight: '100vh' }}>
            <Grid item xs={12} md={6} >   
                <h2 >مودة اسلوب الدعوة الحديثة</h2>
            </Grid>
            <Grid item xs={12} md={6}  >
                <img src={PicHome} style={{width: "100%",  maxHeight: "100%" ,display: "block"}}/>
            </Grid>
        </Grid>
    </div>
    
  );
}

export default Home;
